            </div>
            <div>
                <img src={post.image}/>
            </div>
            <div>
                <p>{post.price}</p>
            </div>
            <button>
                {
                    selected ? <p>Remove Item</p>:<p>Add To Cart</p>
                }
            </button>
            
        </div>
     );
}

